description:
BitEternity is a three-part public chain consisting of BitEternity Chain, BitEternity App and BitEternity chain digital assets;

It is a versatile blockchain App payment system that combines functions such as lightning payment transfer, P2P chat, digital asset trading, blockchain game and blockchain mall;

It is an ecosystem of links to digital assets and the global economy. The aim is to solve the problems of inconvenient user management of various digital assets, complicated transaction process, slow transaction confirmation, poor performance and insufficient application scenarios.
